import React from 'react'
import namedb from './names'

const App = () => {
const nameTable = namedb.names.map(n => n.name)
console.log('nameTable', nameTable)


  return (
    <div>
        <ul>
              {namedb.names.map(n => (
                  <li>{n.name} {n.amount}
                  </li>
              ))}
        </ul>

    </div>
  )

}

export default App
